import React from "react";
function Cart(props) {
  return (
    <div>
      <tr>
        <td>
          <img src="" alt="" />
          {props.title}</td>
        <td>{props.price}</td>
        <td>{props.quantity}</td>
        <td>{props.price*props.quantity}</td>
        <td>
          <button classList='btn-del-goods' type='text'>X</button>
        </td>
      </tr>  
    </div>
  )
}
export default Cart;
